(function ($) {
  var actions = {
    background: function background(object, args) {
      if (App.userAgent.isIE) {
        return imgBackground(object, args);
      }
    },
    gallery: function gallery(object, args) {
      return photoSwipe.init(object);
    }
  };

  function initActions(context) {
    if (_typeof(context) !== "object") {
      context = $('body');
    }

    context.find('[data-action]').each(function () {
      var actionArr = $(this).data('action').split(' ');
      var options = $(this).data();
      delete options.action;
      actionArr.forEach(function (action) {
        if (actions[action]) {
          actions[action]($(this), options);
        }
      });
    });
  }

  initActions();
  App.onAjaxStream.push(initActions);
})(jQuery);

