$('.js-audio').each(function () {
  var self = $(this);
  var src = self.children('source').first();

  if (!src) {
    return false;
  }

  self.hide(0);
  var fileLink = src.attr('src');
  var fileName = fileLink.slice(fileLink.lastIndexOf('/') + 1, fileLink.lastIndexOf('.'));
  var fileType = fileLink.slice(fileLink.lastIndexOf('.') + 1);
  var title = $('<div class="c-audio__title">' + fileName + '</div>');
  var type = $('<div class="c-audio__type">[' + fileType + ']</div>');
  var btn = $('<div class="c-audio__btn">play/pause</div>');
  self.wrap('<div class="c-audio"></div>');
  var container = self.parent();
  title.appendTo(container);
  type.appendTo(container);
  btn.appendTo(container);
  self.on('play', function () {
    btn.text('pause');
    container.addClass('is-active');
  }).on('pause', function () {
    btn.text('play');
    container.removeClass('is-active');
  });
  btn.on('click', function () {
    if (self[0].paused) {
      self[0].play();
    } else {
      self[0].pause();
    }
  });
});
