(function ($) {
  var sidebar = $('.js-sidebar');
  var overlay = $('<div class="c-sidebar-overlay" style="display:none;"/>');

  function close() {
    $('body').removeClass('sidebar-opened');
    $('.js-sidebar-toggle').each(function () {
      $(this).removeClass('is-active');
    });
    sidebar.removeClass('is-expanded');
    overlay.fadeOut(function () {
      overlay.remove();
    });
  }

  function open() {
    $('body').addClass('sidebar-opened');
    $('.js-sidebar-toggle').each(function () {
      $(this).addClass('is-active');
    });
    sidebar.addClass('is-expanded');
    overlay.insertBefore(sidebar).fadeIn();
  }

  $('.js-sidebar-toggle').on('click', function () {
    if (sidebar.is('.is-expanded')) {
      close();
    } else {
      open();
    }
  });
  $(document).on('click touchstart', '.c-sidebar-overlay', function () {
    close();
  });
  App.breakpoints.onBreakpoint('xxs xs sm md', function () {}, function () {
    close();
  });
})(jQuery);

